import "./Iphone11.css"


function Iphone11() {

    const [iphone,setIphone] = useState()

       const getIphone = async ()=>{
        const url = "http://localhost:5000/iphone/iphone11"

        const response = await fetch(url);
        const responseJson = await response.json();

        setIphone(responseJson.iphone)
    }

        useEffect(()=>{
          getIphone()
        },[])

  return (

    <div>
      <div className='chooseColor'>  
        <h3>:בחר צבע</h3>
        </div>

      <div className="colors"> 

        <select >
        <option value="red">RED(PRODUCT)</option>
        <option value="saab">Midnight</option>
        <option value="mercedes">Starlight</option>
        <option value="audi">Purple</option>
        </select>

      </div>


    </div>
  )
}

export default Iphone11
